import "./App.css";
import Navbar from "./components/Navbar";
import Footer from "./components/Fouter";
import Home from "./pages/Home";
import Recipes from "./pages/Recipes";
import About from "./pages/About";
import Contact from "./pages/Contact";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { useState } from "react";


function App() {
  const [inputdata,SetInputdata]=useState({
    name:"",
    rollNo:""
  })

  function changehendle(e){
    SetInputdata({...inputdata,[e.target.name]:e.target.name})
  }

  return (
    <div className="App">
      <Router>
        <Navbar />
        <Routes>
        <Route path='/' exact element={<Home />} />
          <Route path="/recipes" exact element={<Recipes />} />
          <Route path="/about" exact element={<About />} />
          <Route path="/contact" exact element={<Contact />} />
        </Routes>
        <Footer />
      </Router>

      <input type="text" name="name" value={inputdata.name} onChange={changehendle}/>
      <input type="text" name="name" value={inputdata.rollNo} onChange={changehendle}/>

    </div>
  );
}

export default App;
